import React from 'react';
import './Footer.css';
import { Button } from './Button';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <section id="contact" class="contact" style="background: #333; color: white;text-align: justify;padding: 1em;">

      <div class="section-title">
        <h2 style="color: white;font-size: 3.5em;">Contact</h2>
        <p style="color: white;font-size: 1.7em;" class="d-block w-75">For any business enquiries get in touch with me
          through my address and email-id</p>
      </div>


      <div class="address">
        <i class="icofont-google-map" style="font-size: 1.5em;"></i>
        <h4 id="loc">Location: Pune, MH, IN</h4> 
      </div>
      <br/>
      <div class="email">
        <i class="icofont-envelope" style="font-size: 1.5em;"></i>
        <h4 id="ml">Email: devang.manjramkar20@gmail.com</h4>
      </div>

      <iframe src="https://maps.google.com/maps?q=Pune&t=&z=11&ie=UTF8&iwloc=&output=embed" frameborder="0"
        style="border:0; width: 100%; height: 290px;border-radius: 30px;" allowfullscreen></iframe>



    </section>
  );
}

export default Footer;
